struct Time {int h, m;};

int minute(Time t) {return 60 * t.h + t.m;}

bool ok(auto m, auto s, auto e) {
  if(m < minute(s)) return false;
  if(minute(e) < m) return false;
  return true;
}

int main() {
  int N;
  cin >> N;

  vector<vector<Time>> t(N, vector<Time>(6));
  for(auto& v: t) for(auto& i: v) cin >> i.h >> i.m;

  set<int> breakfast, lunch, dinner;
  for(auto v: t) {
    breakfast.emplace(minute(v[0]));
    breakfast.emplace(minute(v[1]));
    lunch.emplace(minute(v[2]));
    lunch.emplace(minute(v[3]));
    dinner.emplace(minute(v[4]));
    dinner.emplace(minute(v[5]));
  }

  auto res = 0;
  for(auto a: breakfast) for(auto b: lunch) for(auto c: dinner) {
    auto sum = 0;
    for(auto v: t) {
      if(!ok(a, v[0], v[1])) continue;
      if(!ok(b, v[2], v[3])) continue;
      if(!ok(c, v[4], v[5])) continue;
      ++sum;
    }
    res = max(res, sum);
  }
  cout << res << endl;
}

