		for (int j = 0; j < 3; ++j) {
			int h,m;cin>>h>>m;
			times[i][j].first=h*60+m;

			int h2,m2;cin>>h2>>m2;
			times[i][j].second=h2*60+m2;
		}
	}
	int ans=0;
	for (int mo = 0; mo < 1440; ++mo) {
		for (int lu = mo + 1; lu < 1440; ++lu) {
			map<int,int>mp;
			for (int i = 0; i < N; ++i) {
				bool valid=true;
				if(mo<times[i][0].first||times[i][0].second<mo)valid=false;
				if(lu<times[i][1].first||times[i][1].second<lu)valid=false;

				if (valid) {
					mp[times[i][2].first]++;
					mp[times[i][2].second+1]--;
				}
			}
			int num=0;
			for (auto m : mp) {
				num+=m.second;
				ans=max(ans,num);
			}
		}
	}
	cout<<ans<<endl;
	return 0;
}

