#include <bits/stdc++.h>
using namespace std;

#define DAY (24*60)

long long me[3][1500] = {};

int cbit(long long bit){
        int ans = 0;
        while(bit > 0){
                ans += (bit & 1);
                bit >>= 1;
        }
        return ans;        
}

int solve(int d, int y, long long bit1, long long bit2, long long bit3){
        if(d == 3) return cbit(bit1 & bit2 & bit3);

        int ans = 0;
        long long old1, old2, old3;
        old1 = old2 = old3 = 0;

        for(int i = y;i < DAY;i++){
                if(old1 != me[0][i] || old2 != me[1][i] || old3 != me[2][i]){
                        old1 = me[0][i];
                        old2 = me[1][i];
                        old3 = me[2][i];
                        ans = max(ans, solve(d+1, i+1, bit1 | old1, bit2 | old2, bit3 | old3));
                }
        }

        return ans;
}

int main(){
        int n;

        long long stbit[3][1500] = {};
        long long enbit[3][1500] = {};

        cin >> n;
        int sth, stm, enh, enm;
        for(long long i = 0;i < n;i++){
                for(int j = 0;j < 3;j++){
                        cin >> sth >> stm >> enh >> enm;
                        int st = sth*60 + stm;
                        int en = enh*60 + enm;
                        stbit[j][st] |= ((long long)1 << i);
                        enbit[j][en] |= ((long long)1 << i);
                }
        }

        long long next[3] = {};

        for(int i = 0;i < DAY;i++){
                for(int j = 0;j < 3;j++){
                        next[j] |= stbit[j][i];
                        me[j][i] = next[j];
                        next[j] = (next[j] & (~enbit[j][i]));
                }
        }

        cout << solve(0, 0, 0, 0, 0) << endl;

        return 0;
}

