using ll = long long;

vector<int> compress(vector<int> v) {
    sort(begin(v), end(v));
    v.erase(unique(begin(v), end(v)), end(v));
    return v;
}

int read_time() {
    int h, m; cin >> h >> m;
    return h * 60 + m;
}

int main() {
    int n; cin >> n;
    vector<vector<int>> s(n, vector<int>(3)), t(n, vector<int>(3));
    vector<vector<int>> xs(3);
    for(int i = 0; i < n; ++i) {
        for(int j = 0; j < 3; ++j) {
            s[i][j] = read_time(), t[i][j] = read_time();
            t[i][j] += 1;
            xs[j].push_back(s[i][j]);
            xs[j].push_back(t[i][j]);
        }
    }
    vector<vector<ll>> sum(3);
    for(int i = 0; i < 3; ++i) {
        xs[i] = compress(move(xs[i]));
        sum[i].resize(xs[i].size());
    }
    for(int i = 0; i < n; ++i) {
        for(int j = 0; j < 3; ++j) {
            s[i][j] = lower_bound(begin(xs[j]), end(xs[j]), s[i][j]) - begin(xs[j]);
            t[i][j] = lower_bound(begin(xs[j]), end(xs[j]), t[i][j]) - begin(xs[j]);
            sum[j][s[i][j]] |= (1LL << i);
            sum[j][t[i][j]] |= (1LL << i);
        }
    }
    const vector<int> sz = { (int)sum[0].size(), (int)sum[1].size(), (int)sum[2].size() };
    for(int i = 0; i < 3; ++i) {
        for(int j = 0; j + 1 < sz[i]; ++j) {
            sum[i][j + 1] ^= sum[i][j];
        }
    }

    int ans = 0;
    for(int i = 0; i < sz[0]; ++i) {
        for(int j = 0; j < sz[1]; ++j) {
            for(int k = 0; k < sz[2]; ++k) {
                ans = max(ans, __builtin_popcountll(sum[0][i] & sum[1][j] & sum[2][k]));
            }
        }
    }

    cout << ans << endl;
}

