typedef pair<int,int> pi;
#define PB push_back
#define F first
#define S second
const int N=5e1+10;
bool later(pi a,pi b){
    return a.F==b.F?a.S<b.S:a.F<b.F;
}
bool isin(pi a,pi b,pi c){
    if(a.F==b.F){
        if(a.S<=b.S){
            if(b.F==c.F){
                if(b.S<=c.S)return true;
            }
            else if(b.F<c.F)return true;
        }
    }
    else if(a.F<b.F){
        if(b.F==c.F){
            if(b.S<=c.S)return true;
        }
        else if(b.F<c.F)return true;
    }
    return false;
}
int max(int a,int b){return a>b?a:b;}
int main(){
    int n,ans=0,temp;
    pi as[N],ae[N],bs[N],be[N],cs[N],ce[N];
    vector<pi> a,b,c;
    scanf("%d",&n);
    for(int i=0;i<n;i++){
        scanf("%d%d%d%d%d%d%d%d%d%d%d%d",&as[i].F,&as[i].S,&ae[i].F,&ae[i].S,&bs[i].F,&bs[i].S,&be[i].F,&be[i].S,&cs[i].F,&cs[i].S,&ce[i].F,&ce[i].S);
        a.PB(as[i]);
        a.PB(ae[i]);
        b.PB(bs[i]);
        b.PB(be[i]);
        c.PB(cs[i]);
        c.PB(ce[i]);
    }
    sort(a.begin(),a.end());
    sort(b.begin(),b.end());
    sort(c.begin(),c.end());
    a.resize(unique(a.begin(),a.end())-a.begin());
    b.resize(unique(b.begin(),b.end())-b.begin());
    c.resize(unique(c.begin(),c.end())-c.begin());
    for(int i=0;i<a.size();i++)for(int j=0;j<b.size();j++)if(later(a[i],b[j]))for(int k=0;k<c.size();k++)if(later(b[j],c[k])){
        temp=0;
        for(int r=0;r<n;r++)if(isin(as[r],a[i],ae[r])&&isin(bs[r],b[j],be[r])&&isin(cs[r],c[k],ce[r]))temp++;
        ans=max(temp,ans);
    }
    printf("%d\n",ans);
}

