const int IMOS_SIZE = 103;

int main()
{
    std::size_t N;
    std::cin >> N;
    std::vector<std::pair<unsigned, std::size_t>> times[3];
    std::vector<unsigned> compressed[3];
    for(std::size_t i = 0; i != N; ++i)
    {
        unsigned a, b, c, d, e, f, g, h, i_, j, k, l;
        std::cin >> a >> b >> c >> d >> e >> f >> g >> h >> i_ >> j >> k >> l;
        times[0].emplace_back(a * 60 + b, i * 2);
        times[0].emplace_back(c * 60 + d, i * 2 + 1);
        times[1].emplace_back(e * 60 + f, i * 2);
        times[1].emplace_back(g * 60 + h, i * 2 + 1);
        times[2].emplace_back(i_ * 60 + j, i * 2);
        times[2].emplace_back(k * 60 + l, i * 2 + 1);
    }
    for(unsigned i = 0; i != 3; ++i)
    {
        std::sort(times[i].begin(), times[i].end());
        compressed[i].resize(N * 2);
        unsigned last = -1;
        unsigned index = 0;
        for(auto val : times[i])
        {
            if(val.first != last)
                ++index;
            compressed[i][val.second] = index;
            last = val.first;
        }
    }
    int imos[IMOS_SIZE][IMOS_SIZE][IMOS_SIZE] = {};
    for(unsigned i = 0; i != N; ++i)
    {
        auto xs = compressed[0][i * 2];
        auto xe = compressed[0][i * 2 + 1] + 1;
        auto ys = compressed[1][i * 2];
        auto ye = compressed[1][i * 2 + 1] + 1;
        auto zs = compressed[2][i * 2];
        auto ze = compressed[2][i * 2 + 1] + 1;
        imos[xs][ys][zs] += 1;
        imos[xs][ys][ze] -= 1;
        imos[xs][ye][zs] -= 1;
        imos[xs][ye][ze] += 1;
        imos[xe][ys][zs] -= 1;
        imos[xe][ys][ze] += 1;
        imos[xe][ye][zs] += 1;
        imos[xe][ye][ze] -= 1;
    }
    for(int z = 0; z < IMOS_SIZE; z++)
    {
        for(int y = 0; y < IMOS_SIZE; y++)
        {
            for(int x = 1; x < IMOS_SIZE; x++)
            {
                imos[z][y][x] += imos[z][y][x - 1];
            }
        }
    }
    for(int z = 0; z < IMOS_SIZE; z++)
    {
        for(int y = 1; y < IMOS_SIZE; y++)
        {
            for(int x = 0; x < IMOS_SIZE; x++)
            {
                imos[z][y][x] += imos[z][y - 1][x];
            }
        }
    }
    for(int z = 1; z < IMOS_SIZE; z++)
    {
        for(int y = 0; y < IMOS_SIZE; y++)
        {
            for(int x = 0; x < IMOS_SIZE; x++)
            {
                imos[z][y][x] += imos[z - 1][y][x];
            }
        }
    }
    // 最大値を調べる
    int tile_max = 0;
    for(int z = 0; z < IMOS_SIZE; z++)
    {
        for(int y = 0; y < IMOS_SIZE; y++)
        {
            for(int x = 0; x < IMOS_SIZE; x++)
            {
                if(tile_max < imos[z][y][x])
                {
                    tile_max = imos[z][y][x];
                }
            }
        }
    }
    std::cout << tile_max << '\n';
}

