int cmp(T *a, T *b) { if (b->n - a->n) return b->n - a->n; return a->t - b->t; }

int main()
{
	int n, i, j, k, at, ht, f, ans;
	long long b, b1;
	T *tp;

	scanf("%d", &n);

	for (b = 1, i = 0; i < n; i++, b <<= 1) for (j = 0; j < 3; j++) {
		int sh, sm, eh, em, t;
		scanf("%d%d%d%d", &sh, &sm, &eh, &em);
		sh = sh*60+sm, eh = eh*60+em;
		for (t = sh; t <= eh; t++) a[j][t] |= b;
	}
	for (j = 0; j < 3; j++) {
		for (tp = tbl[j], i = 0; i < 1440; i++) if (a[j][i] > 0) {
			tp->b = a[j][i], tp->n = bitcount64(a[j][i]), tp->t = i, tp++;
		}
		sz[j] = tp - tbl[j];
		qsort(tbl[j], sz[j], sizeof(T), cmp);
	}

	ans = 0;
	for (i = 0; i < sz[0]; i++) {
		if (tbl[0][i].n <= ans) goto done;
		at = tbl[0][i].t, b1 = tbl[0][i].b;
		for (j = 0; j < sz[1]; j++) {
			if (tbl[1][j].n <= ans) break;
			if ((ht = tbl[1][j].t) <= at) continue;
			b = tbl[1][j].b & b1;
			if (bitcount64(b) <= ans) continue;
			for (k = 0; k < sz[2]; k++) {
				if (tbl[2][k].n <= ans) break;
				if (tbl[2][k].t <= ht) continue;
				if ((f = bitcount64(tbl[2][k].b & b)) > ans) ans = f;
			}
		}
	}
done:
	printf("%d\n", ans);
	return 0;
}

