		for (int i = 0; i < 3; i++) {
			int _ans = 0;
			for (int j = 1; j <= 1440; j++) {
				ahb[i][j] += ahb[i][j - 1];
				_ans = Math.max(_ans, ahb[i][j]);
			}
			ans = Math.min(ans, _ans);
		}

		System.out.println(ans);
	}
}

